column8:
小型だけどパワフルな300W！！<br><br>
今注目の自然エネルギーで自家発電！！<br><br>
CO2を発生させない環境にもやさしいクリーンな発電方法！！<br><br>
昼間はソーラーパネルで太陽光発電、<br><br>
天気の悪い日でも風があればいつでも風力発電ができます。<br><br>
アイデア次第で色々な電源供給にお役立ちできます。<br><br>
尾調整も可能！！<br><br>
コントローラーのいらない<br><br>

<img src="http://www.rakuten.ne.jp/gold/milkvetch/img/lp/pc/diy/hatsudenki/cf400w.jpg"><br>
<img src="http://www.rakuten.ne.jp/gold/milkvetch/img/lp/pc/diy/hatsudenki/058bc.jpg"><br>
<img src="http://www.rakuten.ne.jp/gold/milkvetch/img/lp/pc/diy/hatsudenki/058c9bc.jpg"><br>
●スペック●<br>
定格出力：400W<br>
最大出力：450W<br>
出力電圧：DC24V <br>
出力電流：17A<br>
スタートアップ風速：3m/s<br>
カットイン風速：3m/s<br>
カットアウト風速：15m/s<br>
耐風速：40m/s <br>
安全風速：45m/s <br>
ブレード直径：1140mm<br>
材質：カーボンファイバー<br> 
枚数：6枚 <br>
重量：約5kg <br>
取付ポールサイズ：約51mm<br>
尾調整可能<br>
●MPPTは付属しておりません。<br>
●取付ポールはホームセンターなどにある足場組用のパイプ(単管)をお求めください。<br><p>●輸入品について<br>
輸送中のトラブルで動作不具合等が起こる場合もございます。<br>
日本語の取り扱い説明書が無い商品も多数御座いますので、事前にご確認をお願いいたします。<br>
箱・商品に製造時や輸送時に付いてしまったとみられる多少のキズ・凹み・曲がり・汚れがある場合がありますが、本来の性能に異常がない場合は一切対応出来ません。<br>
予告なく多少のデザイン・色・仕様が変わってしまう場合があります。<br>
※ショッピングガイドを必ずご確認ください。</p><img src="http://www.rakuten.ne.jp/gold/milkvetch/img/shoppingguide.jpg" alt="ショッピングガイド" width="517" height="138" />


<p>●配送業者について<br>
当店は全国最安値を実現する為に、配送業者を場所によって指定させて頂いております。<br>
配送業者によってはサービスに差がありご迷惑をお掛けする場合もあるかと思いますが、変わらないサービス維持のため、どうぞご理解とご協力を宜しくお願いいたします。</p><style type="text/css">
